import Journal from "../images/journal.jpg"
import Book from "../images/book.jpg";
import Project from "../images/project.jpg"


export const ResearchData = [

  {
    image: Journal,
    heading: "Published Articles",
    paragraph: "You have free access to some of the articles published by LisaConsult",
    articles : {
        article1: <a href="https://redfame.com/journal/index.php/afa/article/view/2723/2874">Relationship between Organizational Climate, Employee Psychological Empowerment, and Innovation</a>,
        article2: <a href="https://ideas.repec.org/a/rfa/afajnl/v2y2016i2p30-45.html">Top Management Team Demographic Diversities, Generic Strategy and Firm Performance</a>,
        article3: <a href="http://ir.mksu.ac.ke/handle/123456780/4835">The Moderating Effect Of Decision-Maker On The Relationship Between Strategy And Organizational Structure</a>
    }
  },

  {
    image: Book,
    heading: "Books",
    paragraph: "Some of the books, which are ready to be published are:",
    articles : {
        article1: <a href="#">Success is a Matter of Personal Choice</a>,
        article2: <a href="#">Security Investment</a>,
        article3: <a href="#">Stress Management Strategies</a>
    }
  },

  {
    image: Project,
    heading: "Research Projects",
    paragraph: "Research is the basis for solutions, success, satisfaction, happiness and health.",
    articles : {
        article1: <a href="">Eritrean refugees stress-coping Strategies and Psychological well-being</a>,
        article2: "National Reconciliation",
        article3: "Strategic Leadership"
    }
  },

];
